    <style>
    body {
        padding: 0;
        margin: 0;
        background: #000
    }

    .div {
        border-radius: 10px;
        font-size: 30px;
        margin: 0 auto;
        max-width: 30%;
        display: inline-block;
        font-family: Arial, Helvetica, sans-serif;
        background: rgba(0, 0, 0, .54118);
        padding: 20px 50px
    }

    .wrapper {
        width: 100%;
        top: 25%;
        text-align: center;
        position: absolute;
        color: #fff;
        left: 0
    }

    @media screen and (max-width: 1024px) {
        .div {
            background: rgba(0, 0, 0, .54118);
            border-radius: 10px;
            padding: 20px 0;
            margin: 0 auto;
            display: inline-block;
            font-size: 25px;
            max-width: 85%;
            font-family: Arial, Helvetica, sans-serif
        }

        .wrapper {
            text-align: center;
            color: #fff;
            top: 3%;
            width: 100%;
            left: 0;
            position: absolute
        }
    }
    
    #captcha{
        position: relative;
        z-index: 1;
        position: absolute;
        left: 50%;
        top: 50%;
        -webkit-transform: translate(-50%, -50%);
        transform: translate(-50%, -50%);
    }

    #captcha img{
        background:#fff;
        padding: 30px 30px;
        -webkit-border-radius: 8px;
        -moz-border-radius: 8px;
        border-radius: 8px;
    }

    #captcha img:hover{
        cursor: pointer;
    }

    #blocker{
        position: fixed;
        top: 0;
        right: 0;
        bottom: 0; 
        left: 0;
        width: 100%;
        height: 100%;
        overflow: auto;
        z-index: 1;
        padding: 20px;
        box-sizing: border-box;
        background-color: #000;
        background-color: rgba(0,0,0,0.9);
        text-align: center;
    }
